webpackJsonp([36664502008275],{402:function(o,e){o.exports={data:{site:{siteMetadata:{title:"Blog",author:"lxynox"}},markdownRemark:{id:"/Users/lxy/Dev/code/blog/src/posts/DIY-mobile-desktop.md absPath of file >>> MarkdownRemark",html:'<h1>Intro</h1>\n<p>Have your ever thought of <strong>D.I.Y</strong> your iphone desktop? Of course, you did(only if you’re not a iPhone user). It’s stupid simple, just drag &#x26; drop\nyour app icons. Have you ever thought of organize your mobile apps into archives? Probably, you did(if you don’t want to spend <em>HOURS</em> finding\nan app. Have you ever thought of using <em>emoji</em> to be the only title of your organized archives? Probably not, if not here is something you may give a try!</p>\n<h1>Screenshot</h1>\n<p><img src="https://lxynox.github.io/gitcloud/files/img/blog/iphone-layout-update.PNG" alt="my iphone7 desktop"></p>\n<h1>Bye</h1>\n<p>When talking about customizing/hacking iphone, google usually sends us to <code class="language-text">iphone jailbreak</code>, but there is definitely some technical bars/safety concerns for many users to do that. As iOS is <a href="https://simple.wikipedia.org/wiki/Closed_source">closed source </a>, developers tend to do different hacks to acquire higher permission for more control, but we can always find some useful tricks without too much hassle. Give the <code class="language-text">assistive touch</code> a look if you prefer single hand operation on your mobile.</p>\n<p>Have fun and rock with your iPhone!</p>',frontmatter:{title:"DIY mobile desktop",date:"November 15, 2016"}}},pathContext:{slug:"/blog/posts/diy-mobile-desktop/",previous:{fields:{slug:"/blog/posts/some-words-about-vim/"},frontmatter:{title:"some words about vim"}},next:{fields:{slug:"/blog/posts/bottom-up/"},frontmatter:{title:"Bottom Up"}}}}}});
